const SignUpFormImage = () =>{
    return(
            <>
                  <div className="col-lg-7 col-sm-12">
                                <div className="card">
                                    <img src="dash/assets/images/signin2.png" alt="Sign Up" />
                                </div>
                    </div>
            </>
    )
}
